import React from 'react';
import FuncCard from "./components/FuncCard";
import "./App.css"
import ClassCard from "./components/ClassCard";

function App() {
    let heading = "online class";

  return (
    <div className="App">
      <nav className="main-nav">
          <a href="/">Wellcome to Components</a>
      </nav>
        <FuncCard info={heading} />
        <ClassCard info={heading} />
    </div>
  );
}

export default App;
